import data from "./data.js";

function Display({name, price, pictures, seller}

    )
    {

    return (<div>

    <div>{name}</div>
    <div>{price}</div>
    <div>{pictures}</div>
    <ul>{data[0].seller.name}</ul>
    <ul>{data[0].seller.firstName}</ul>

    </div>
    
    )
}


export default Display;
